import React from "react";
import Filebox from "./Filebox";
import LectureBar from "./LectureBar";
class App extends React.Component {
  render() {
    return (
      <div>
        <LectureBar />
        <Filebox />
        <Filebox />
      </div>
    );
  }
}

export default App;
